in_source: |-
  (begin
      (setq a 5)
      (defun square (begin x) (begin (* x x)))
      (defun factorial (begin x)
          (begin
              (setq b (square x))
              (cond
                  (<= x 1) (begin 1)
                  (> x 1) (begin (* x (factorial (- x 1))))
              )
          )
      )
      (setq a (factorial a))
  )
